const NavBar = (props: any) => {
    return (
        <>
            <div className='flex justify-around mb-7 mt-16'>
                <TitleLogo></TitleLogo>
                <ListNav></ListNav>
                {/* <GroupInputHome></GroupInputHome> */}
            </div>
            <Line></Line>
        </>
    );
};

export default NavBar;
